-left:16px;margin-top:0px;margin-bottom:0px; list-style-image:url(\'images/text377672CircleBulletFont8.png\'); padding-left:7px;\"><!--{ \ndata-bltIndnt:0\n} --><span class=\"text377672Font3\"  >The key policy documents and legislation that inform your handling of official information\n</span ></li >\n<li  class=\"text377672Font3\" data-bltIndnt=\"0\" style=\"line-height:1.229;position:relative;margin-left:16px;margin-top:0px;margin-bottom:0px; list-style-image:url(\'images/text377672CircleBulletFont8.png\'); padding-left:7px;\"><!--{ \ndata-bltIndnt:0\n} --><span class=\"text377672Font3\"  >The basic principles of access to official information&nbsp;\n</span ></li >\n<li  class=\"text377672Font3\" data-bltIndnt=\"0\" style=\"line-height:1.229;position:relative;margin-left:16px;margin-top:0px;margin-bottom:0px; list-style-image:url(\'images/text377672CircleBulletFont8.png\'); padding-left:7px;\"><!--{ \ndata-bltIndnt:0\n} --><span class=\"text377672Font3\"  >Best practice tips for handling official information\n</span ></li >\n<li  class=\"text377672Font3\" data-bltIndnt=\"0\" style=\"line-height:1.229;position:relative;margin-left:16px;margin-top:0px;margin-bottom:0px; list-style-image:url(\'images/text377672CircleBulletFont8.png\'); padding-left:7px;\"><!--{ \ndata-bltIndnt:0\n} --><span class=\"text377672Font3\"  >A brief overview of the new classification system \n</span ></li >\n</ul >\n\n\n</div></td>\n</tr>\n</table>\n</div>\n');
